import React from 'react'
import useFormContext from '../../Hooks/useFormContext'
import DisplayInfo from './DisplayInfo'

function ReviewInfo() {
  const { userData, commonStepFormContainerClasses, commonDisplayInfoSetClasses } = useFormContext()

  return (
    <div className={commonStepFormContainerClasses}>
      <div className={commonDisplayInfoSetClasses}>
        <DisplayInfo
          labelText="First Name"
          infoText={userData.firstName}
        />
        <DisplayInfo
          labelText="Last Name"
          infoText={userData.lastName}
        />
      </div>
    </div >
  )
}

export default ReviewInfo
